import React from 'react'
import Banner from '../Banner'

class About extends React.Component {
    render(){
        return (
            <>
            <Banner 
                backgroundImage="url(assets/img/bg-gift.jpg)"
                title="PNTBLOG"
                subtitle="Login or Register to read content on blog"
            />
            </>
            
        )
    }
}

export default About
